  \"2014-09-17T19:04:40.323085\",\n\t\"name\": \"aerial-photography-and-imagery-ortho-corrected-2013-digital-orthophotos-gilchrist-county\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a collection of GeoTIFF
  and MrSID format natural color orthophotos covering Gilchrist County, Florida. An
  orthophoto is remotely sensed image data in which displacement of features in the
  image caused by terrain relief and sensor orientation have been mathematically removed.
  Orthophotography combines the image characteristics of a photograph with the geometric
  qualities of a map. Imagery was acquired for the County at 0.9 foot ground sample
  distance (GSD) resolution. The imagery was captured at 12-bit radiometric resolution
  and converted to 8-bit radiometric resolution during post processing. The imagery
  was captured with 30% sidelap between all adjacent flight lines. The imagery was
  obtained and processed by all digital means beginning with data acquisition using
  a Z/I Imaging Digital Mapping Camera (DMCII). The orthophotos are available in GeoTIFF
  and MrSID form. The projected coordinate system is State Plane Florida North (FIPS
  Zone 903), NAD 83 HARN, GRS 80, Units Survey Feet.\",\n\t\"license_title\": null,\n\t\"extras\":
